import React, { useEffect, useState } from "react";
//import TaskComponent from "../Tasks/TaskComponent";
import AddTaskFormik from "../Form/AddTaskFormik";
import TaskListComponent from "../Tasks/TaskListComponent";
import TaskComponent from "../Tasks/Task";
// import { LEVELS } from "../Tasks/levels.enum";
// import { Task } from "../Tasks/task.class";

const TaskCard = () => {
  const [tasks, setTasks] = useState([]);

  const addTask = (task) => {
    const temptask = [...tasks];
    temptask.push(task);
    setTasks(temptask);
    console.log("estoy en card");
    console.log(task);
  };

  return (
    <div>
      <div className="card">
        <div className="card-header">card-header</div>
        <div className="card-body">
          card-body
          {/* <TaskListComponent anotherTask={newTask}></TaskListComponent> */}
          <table>
            <theader>
              <tr>
                <th>Titulo</th>
                <th>Descripcion</th>
                <th>Prioridad</th>
                <th>Acciones</th>
              </tr>
            </theader>
            <tbody>
              {tasks.map((task, index) => {
                return <TaskComponent key={index} task={task}></TaskComponent>;
              })}
            </tbody>
          </table>
        </div>
        <div className="card-footer">
          card-footer
          <AddTaskFormik add={addTask} />
        </div>
      </div>
    </div>
  );
};

export default TaskCard;
